// IDE 경고내기 private const string CATEGORY = "GeneratedNamespace";
public static readonly DiagnosticDescriptor ExistsOverrideToString = new DiagnosticDescriptor( id: "SAMPLE001", title: "ToString override", messageFormat: "The GenerateToString class '{0}' has ToString override but it is not allowed", category: CATEGORY, defaultSeverity: DiagnosticSeverity.Error, isEnabledByDefault: true
); SourceProductionContext context;
context.ReportDiagnostic(Diagnostic.Create(DiagnosticDescriptors.ExistsOverrideToString, typeNode.Identifier.GetLocation(), typeSymbol.Name)); ReportDiagnostic Enum Default 0 Report a diagnostic by default. Error 1 Report a diagnostic as an error. Warn 2 Report a diagnostic as a warning even though /warnaserror is specified. Info 3 Report a diagnostic as an info. Hidden 4 Report a diagnostic as hidden. Suppress 5 Suppress a diagnostic.
